import React from 'react';
import "./PlayerControls.css";
import Filler from "./Filler"
const PlayerControls = (props) => {
	return(
		<div>
			<div className="progress-bar">
				<Filler percentage={props.percentage} />
			</div>
		</div>
		);
};

export default PlayerControls
